import React from 'react';
import {Icon} from 'rsuite';
import Faq from './src/FAQ';



const title = {
  "heading":"FAQ"
}

const faqData = [

  {
    Question: <span><Icon icon="user"/>how are you</span>,
    Answer: 'answer',
  },
  {
    Question: 'hey this is FAQ',
    Answer: 'this is answer',
  },
  {
    Question: 'hey this is FAQ',
    Answer: 'this is answer',
  },
];

const headingStyle = {
  textAlign:"center"
}



function App() {
  return (
    <div>
     <Faq
     faqData={faqData}
     title={title}
     headingStyle={headingStyle}/>
    </div>
  );
}

export default App;
